using namespace std;
string bin2str(int k){
    string s = "";
    while(k>0){
        s = to_string(k%2) + s;
        k/=2;
    }
    while(s.length()!=32){
        s = "0"+s;
    }
    return s;
}

class trie{
public:
struct node{
    node* children[2];
    int prefix;
    vector<int> wend;
    int fd;
    node(){
        for(int i=0;i<2;i++)children[i]=NULL;
        prefix=0;
        fd=0;
    }
};
    node *root;
    trie(){
        root = new node();
    }
    void insert(string& s, int v){
        node* nd = root;
        int i=0;
        nd->fd = s.length()-1;
        while(i<s.length()){
            if(nd->children[s[i]-'0']!=NULL){
                nd = nd->children[s[i]-'0'];
                nd->prefix++;
                i++;
                continue;
            }
            nd->children[s[i]-'0'] = new node();
            int k = nd->fd;
            nd = nd->children[s[i]-'0'];
            nd->fd = k-1;
            nd->prefix++;
            i++;
        }
        nd->wend.push_back(v);
    }

    int get(string& s){
        node *nd = root;
        int i=0;
        while(nd->wend.size()==0){
            if(s[i]=='0'){
                if(nd->children['1'-'0']!=NULL){
                    nd = nd->children['1'-'0'];
                }
                else{
                    nd = nd->children['0'-'0'];
                }
            }
            if(s[i]=='1'){
                if(nd->children['0'-'0']!=NULL){
                    nd = nd->children['0'-'0'];
                }
                else{
                    nd = nd->children['1'-'0'];
                }
            }
            i++;
        }
        return nd->wend[0];
    }
};


